import React, { Component } from "react";
import {  Divider, Image, Segment } from 'semantic-ui-react'

class Pato extends Component {
    render() {
        return (
            <div>
                    <Divider style={{marginTop:"100px"}} />
                    <Image centered src={"../images/group/acote.png"} size='big' />
                    <Segment centered attached style={{ textAlign:"center"}} color='violet'>A wonderful evening with Fílipa Pato and Willem Wouters at À Côté.</Segment>
                    <Divider hidden />
            </div>
        );
    }
}

export default Pato;
